Great Migrations

Nature Documentary hosted by Stephen Fry, published by National Geographic in 2010 - English narration


Information
------------------------------

National Geographic's: Great Migrations
The miracles of animal mass migratory habits are captured as never before in this groundbreaking programming event: Great Migrations. The series features unique, mesmerising footage of journeys around the globe undertaken by a cast of millions in an epic struggle to survive.See how our team of skilled and dedicated nature film-makers travelled 67,000 kilometres, shooting from land and air, on ice floes and underwater, to chronicle epic animal migration.
Narrated by Stephen Fry, the series captures some of the planet's most breathtaking species and their odysseys of survival.



2)  Need to Breed 
Every day, migrating creatures around the world wage incredible journeys; risking it all in pursuit of the one thing more precious than themselves: the creation and caretaking of their precious young - the next generation of global wanderers. From the rocky beaches of the Falkland Islands to the dense forests of Costa Rica and Australia to the desolate savannah of southern Sudan, countless animals now venture forth on timeless journeys, bent on their own survival -- and the survival of their species.



